import React, { useEffect } from 'react';
import './App.css';
import io from 'socket.io-client';
import ModalLogin from './components/ModalLogin';
import useModal from './components/useModal';
import { onData } from './components/Utiles';


export const socket = io("ws://localhost:5000");

function App() {



  const sendMessage = () => {
    socket.emit('message', 'Hello World!');
  };
  onData('message', (data) => {console.log(data)})


  const {isOpen:isOpenLogin,openModal:openModalLogin,closeModal:closeModalLogin} = useModal(() => 
    {return <ModalLogin isOpen={isOpenLogin} socket={socket} closeModal={closeModalLogin} />})

  return (
    <div className="App">
      <button onClick={sendMessage}>sned message</button>
      <button onClick={openModalLogin}></button>
    </div>
  );
}

export default App;
